module ElementaryProofs where

import Deduce
import qualified Data.Map as Map

eproof' (a, [b,c]) [lhs, rhs] = 
    let 
        proof = eproof (a,[b,c])
        proof' = replace_vars' (Map.fromList [('A', lhs), ('B', rhs)]) proof
    in
        proof'

eproof' (a, [b]) [lhs] = 
    let 
        proof = eproof (a,[b])
        proof' = replace_vars' (Map.fromList [('A', lhs)]) proof
    in
        proof'

